import React from "react";

export const ItemsOfList = (props) => {
  const { icon, item, titleStyle , pon} = props;
  return (
    <div>
      <li className="sidebar_menu_item d-flex justify-content-start align-items-center">
        <i className={`icon fas ${icon} text-light bg-dark`}></i>
        <span className={`items_of_sidebar_list text-light ${titleStyle}`}>{item}</span>
      </li>
    </div>
  );
};
